function Pagination({total,record}){

    let n=math.ceil(total/record)

    let page=[]
    for(let i=0 ;i<n; i++){
page.push(i)
    }

    return(


        <div>
            <ul className="pagination">
            {page.map((item)=>(
                <li className="page-item">
                    <a className="page-link">{item}</a>
                </li>
               ) )}
            </ul>


        </div>
    )
}
export default Pagination;
